import React from "react";
import { Carousel } from "react-bootstrap/";
import "bootstrap/dist/css/bootstrap.min.css";

const Poto = (props) => {
  return (
    <Carousel.Item>
      <img className="d-block w-100" src={props.img} />
    </Carousel.Item>
  );
};

export default Poto;
